import React from 'react';
import { TodoListItem } from './TodoListItem';
import { TodoTexteFoot } from './TodoTexteFoot';

const todos: Todo[] = [
  {
    text: 'Walk the dog',
    complete: false,
  },
  {
    text: 'Write app',
    complete: true,
  },
];

function App() {
  return (
    <>
      <ul>
        <TodoListItem todo={todos[0]} />
        <TodoListItem todo={todos[1]} />
      </ul>
      <TodoTexteFoot input={todos[1]} />
    </>
  );
}

export default App;
